Generate a public/private key pair using the specified method and seed. The available methods are items in the Sapphire.SigningAlg enum. Note, however, that the generation method ignores subvariants, so all three Ed25519-based are equivalent, and all Secp256k1 & Secp256r1 based methods are equivalent. Sr25519 is not available and will return an error. Precompile address 0x0100000000000000000000000000000000000005 Gas Cost Ed25519: 1,000 gas 0 (Ed25519Oasis) 1 (Ed25519Pure) 2 (Ed25519PrehashedSha512) Secp256k1: 1,500 gas. 3 (Secp256k1Oasis) 4 (Secp256k1PrehashedKeccak256) 5 (Secp256k1PrehashedSha256) Secp256r1: 4,000 gas 7 (Secp256r1PrehashedSha256) Secp384r1: 18,000 gas 8 (Secp384r1PrehashedSha384) Key Formats Ed25519 Public key: 32 bytes Secret key: 32 bytes Secp256k1 & Secp256r1 Public key: 33 bytes, compressed format (0x02 or 0x03 prefix, then 32 byte X coordinate). Secret key: 32 bytes Secp384r1 Public key: 49 bytes, compressed format (0x02 or 0x03 prefix, then 48 byte X coordinate). Secret key: 48 bytes Example bytes memory seed = hex"0123456789abcdef0123456789abcdef0123456789abcdef0123456789abcdef";
bytes memory publicKey;
bytes memory privateKey;
(publicKey, privateKey) = Sapphire.generateSigningKeyPair(Sapphire.SigningAlg.Ed25519Pure, seed); function generateSigningKeyPair(SigningAlg alg, bytes memory seed) internal view returns (bytes memory publicKey, bytes memory secretKey); Parameters Name Type Description alg SigningAlg The signing alg for which to generate a keypair. seed bytes The seed to use for generating the key pair. You can use the randomBytes method if you don't already have a seed. Returns Name Type Description publicKey bytes The public part of the keypair. secretKey bytes The secret part of the keypair.

