Sign a message within the provided context using the specified algorithm, and return the signature. The context_or_digest and messages parameters change in meaning slightly depending on the method requested. For methods that take a context in addition to the message you must pass the context in the context_or_digest parameter and use message as expected. For methods that take a pre-existing hash of the message, pass that in context_or_digest and leave message empty. Specifically the Ed25519Oasis and Secp256k1Oasis variants take both a context and a message (each are variable length bytes), the context serves as a domain separator. Precompile address 0x0100000000000000000000000000000000000006 Gas cost See below for the method-dependent base cost, plus 8 gas per 32 bytes of context and message except digest. Signing algorithms 0 (Ed25519Oasis): 1,500 gas, variable length context and message. 1 (Ed25519Pure): 1,500 gas, empty context, variable length message. 2 (Ed25519PrehashedSha512): 1,500 gas, pre-existing SHA-512 hash (64 bytes) as context, empty message. 3 (Secp256k1Oasis): 3,000 gas, variable length context and message 4 (Secp256k1PrehashedKeccak256): 3,000 gas, pre-existing hash (32 bytes) as context, empty message. 5 (Secp256k1PrehashedSha256): 3,000 gas, pre-existing hash (32 bytes) as context, empty message. 7 (Secp256r1PrehashedSha256): 9,000 gas, pre-existing hash (32 bytes) as context, empty message. 8 (Secp384r1PrehashedSha384): 43,200 gas, pre-existing hash (32 bytes) as context, empty message. Example Sapphire.SigningAlg alg = Sapphire.SigningAlg.Ed25519Pure;
bytes memory pk;
bytes memory sk;
(pk, sk) = Sapphire.generateSigningKeyPair(alg, Sapphire.randomBytes(32, ""));
bytes memory signature = Sapphire.sign(alg, sk, "", "signed message"); Note: @oasisprotocol/oasis-sdk :: precompile/confidential.rs :: call_sign function sign(SigningAlg alg, bytes memory secretKey, bytes memory contextOrHash, bytes memory message) internal view returns (bytes memory signature); Parameters Name Type Description alg SigningAlg The signing algorithm to use. secretKey bytes The secret key to use for signing. The key must be valid for use with the requested algorithm. contextOrHash bytes Domain-Separator Context, or precomputed hash bytes. message bytes Message to sign, should be zero-length if precomputed hash given. Returns Name Type Description signature bytes The resulting signature.

