Verifies that the provided digest was signed with using the secret key corresponding to the provided private key and the specified signing algorithm. The method, context_or_digest and message parameters have the same meaning as described above in the sign() function. Precompile address 0x0100000000000000000000000000000000000007 Gas cost The algorithm-specific base cost below, with an additional 8 gas per 32 bytes of context and message for the Ed25519Oasis, Ed25519Pure and Secp256k1Oasis algorithms. 0 (Ed25519Oasis): 2,000 gas 1 (Ed25519Pure): 2,000 gas 2 (Ed25519PrehashedSha512): 2,000 gas 3 (Secp256k1Oasis): 3,000 gas 4 (Secp256k1PrehashedKeccak256): 3,000 gas 5 (Secp256k1PrehashedSha256): 3,000 gas 7 (Secp256r1PrehashedSha256): 7,900 gas 8 (Secp384r1PrehashedSha384): 37,920 gas Example Sapphire.SigningAlg alg = Sapphire.SigningAlg.Secp256k1PrehashedKeccak256;
bytes memory pk;
bytes memory sk;
bytes memory digest = abi.encodePacked(keccak256("signed message"));
(pk, sk) = Sapphire.generateSigningKeyPair(alg, Sapphire.randomBytes(32, ""));
bytes memory signature = Sapphire.sign(alg, sk, digest, "");
require( Sapphire.verify(alg, pk, digest, "", signature) ); Note: @oasisprotocol/oasis-sdk :: precompile/confidential.rs :: call_verify function verify( SigningAlg alg, bytes memory publicKey, bytes memory contextOrHash, bytes memory message, bytes memory signature
) internal view returns (bool verified); Parameters Name Type Description alg SigningAlg The signing algorithm by which the signature was generated. publicKey bytes The public key against which to check the signature. contextOrHash bytes Domain-Separator Context, or precomputed hash bytes message bytes The hash of the message that was signed, should be zero-length if precomputed hash was given. signature bytes The signature to check. Returns Name Type Description verified bool Whether the signature is valid for the given parameters.
